
drop database IF EXISTS EmpresasInformaticas;
CREATE DATABASE EmpresasInformaticas;

USE EmpresasInformaticas;


-- Eliminar
DROP TABLE if exists FacturaComponente ;
DROP TABLE if exists Factura;
DROP TABLE if exists Componente;
DROP TABLE if exists TipoComponente;
DROP TABLE if exists Tienda;



-- Crear Tablas
CREATE TABLE Componente (
  clave VARCHAR(20) NOT NULL primary key, 
  descripcion VARCHAR(255), 
  precio FLOAT, 
  CodTipo INT
) engine=innodb default charset=utf8;


CREATE TABLE Factura (
  NFactura INT NOT NULL primary key, 
  Fecha DATETIME, 
  Cliente VARCHAR(255), 
  idTienda INT
) engine=innodb default charset=utf8;

CREATE TABLE FacturaComponente (
  Id INT NOT NULL primary key, 
  NFactura INT, 
  CodComponente VARCHAR(20), 
  Referencia VARCHAR(255), 
  Cantidad INT, 
  PrecioAplicado FLOAT
) engine=innodb default charset=utf8;

CREATE TABLE Tienda (
  IdTienda INT NOT NULL primary key, 
  NombreTienda VARCHAR(255), 
  Direccion VARCHAR(255), 
  Localidad VARCHAR(255), 
  Telefono VARCHAR(30)
) engine=innodb default charset=utf8;

CREATE TABLE TipoComponente (
  CodTipo INT NOT NULL primary key, 
  Tipo VARCHAR(255)
) engine=innodb default charset=utf8;


